body{
    margin: 0px;
    padding: 0px;
    height: 100%;
}
html{
    margin: 0;
    padding: 0;
    height: 100%;
}
*{
    position: relative;
}
.wrapper{
    height: 100%;
    background: url("51586adb9bd5c7fff18d441d72df51fd.jpg") center center fixed no-repeat;
    background-size: cover;
}
.square{
    height: 500px;
    width: 500px;
    background-color: rgba(0, 0, 0, 0.5);
    -webkit-animation: squareAppear 1s 1s;
    -o-animation: squareAppear 1s 1s;
    animation: squareAppear 1s 1s;
}
.center{
    position: fixed;
    top: 50%;
    left: 50%;
    -webkit-transform: translate(-50%, -50%);
    -moz-transform: translate(-50%, -50%);
    -ms-transform: translate(-50%, -50%);
    -o-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
}
.text{
    font-family: "Noto Sans TC" ;
    color: aliceblue;
    font-size: 2em;
    overflow: hidden;
    -ms-text-overflow: ellipsis;
    text-overflow: ellipsis;
}
@keyframes squareAppear {
    0%{
        width: 0;
        height: 0;
    }
    100%{
        height: 500px;
        width: 500px;
    }
}
